import React from 'react';
import Brand from '../Brand/Brand';

export default function BrandsContainer({data}) {
    return (
        <div class="container">
         <div class="row justify-content-md-center"></div>
            <div class="col-sm-4 col-lg-6">
                {data.map((item,index)=>
                    <Brand key={index} data={item}></Brand>
                )}
            </div>
        </div>
    )
}
